// Шаг 2: Очистка текста
// Убираем знаки препинания и приводим к нижнему регистру
function cleanText(text) {
    return text.toLowerCase().replace(/[^\w\s]/g, '');
}

// Шаг 3: Исправление опечаток
class SpellChecker {
    constructor(words) {
        this.wordSet = new Set(words);
    }

    correct(word) {
        if (this.wordSet.has(word)) return word;

        let minDistance = Infinity;
        let closestWord = word;
        for (const knownWord of this.wordSet) {
            const distance = levenshteinDistance(word, knownWord);
            if (distance < minDistance) {
                minDistance = distance;
                closestWord = knownWord;
            }
        }
        return minDistance <= 2 ? closestWord : word;
    }
}

function levenshteinDistance(a, b) {
    const matrix = Array(b.length + 1).fill(null).map(() => Array(a.length + 1).fill(null));
    for (let i = 0; i <= a.length; i++) matrix[0][i] = i;
    for (let j = 0; j <= b.length; j++) matrix[j][0] = j;
    for (let j = 1; j <= b.length; j++) {
        for (let i = 1; i <= a.length; i++) {
            const indicator = a[i - 1] === b[j - 1] ? 0 : 1;
            matrix[j][i] = Math.min(
                matrix[j][i - 1] + 1,
                matrix[j - 1][i] + 1,
                matrix[j - 1][i - 1] + indicator
            );
        }
    }
    return matrix[b.length][a.length];
}

// Шаг 4: Генератор текста на основе марковских цепей
class MarkovGenerator {
    constructor(text, order = 2) {
        this.order = order; // Порядок марковской цепи (2 = биграммы)
        this.words = cleanText(text).split(' ');
        this.spellChecker = new SpellChecker(this.words);
        this.words = this.words.map(word => this.spellChecker.correct(word));
        this.insults = ['ебаный', 'мудак', 'пиздец', 'хуй', 'мразь', 'сука', 'дебил', 'шлюха', 'похер', 'уебок'];
        this.chain = new Map();
        this.buildChain();
    }

    // Строим марковскую цепь
    buildChain() {
        for (let i = 0; i < this.words.length - this.order; i++) {
            const key = this.words.slice(i, i + this.order).join(' ');
            const nextWord = this.words[i + this.order];
            if (!this.chain.has(key)) {
                this.chain.set(key, new Map());
            }
            const nextWords = this.chain.get(key);
            nextWords.set(nextWord, (nextWords.get(nextWord) || 0) + 1);
        }
    }

    // Выбираем следующее слово
    chooseNextWord(key, usedWords) {
        const nextWordsMap = this.chain.get(key) || new Map();

        // Фильтруем слова, которые недавно использовались
        const availableWords = [];
        for (const [word, freq] of nextWordsMap) {
            if (!usedWords.includes(word)) {
                availableWords.push({ word, freq });
            }
        }

        // Если нет доступных слов, выбираем случайное из базы
        if (availableWords.length === 0) {
            let randomWord;
            do {
                randomWord = this.words[Math.floor(Math.random() * this.words.length)];
            } while (usedWords.includes(randomWord));
            return randomWord;
        }

        // Вероятностный выбор
        const total = availableWords.reduce((sum, { freq }) => sum + freq, 0);
        let rand = Math.random() * total;
        for (const { word, freq } of availableWords) {
            rand -= freq;
            if (rand <= 0) return word;
        }
        return availableWords[0].word;
    }

    // Генерируем текст
    generate(length, aggressionLevel) {
        let result = [];
        let usedWords = []; // Очередь для контроля повторений (окно из 10 слов)

        // Начинаем с случайной последовательности
        const keys = Array.from(this.chain.keys());
        let currentKey = keys[Math.floor(Math.random() * keys.length)];
        result = currentKey.split(' ');
        usedWords = [...result];

        while (result.length < length) {
            const nextWord = this.chooseNextWord(currentKey, usedWords);
            result.push(nextWord);

            // Обновляем очередь использованных слов
            usedWords.push(nextWord);
            if (usedWords.length > 10) {
                usedWords.shift();
            }

            // Добавляем агрессию
            if (aggressionLevel !== 'low' && Math.random() < (aggressionLevel === 'high' ? 0.5 : 0.2)) {
                const insult = this.insults[Math.floor(Math.random() * this.insults.length)];
                if (!usedWords.includes(insult)) {
                    result.push(insult);
                    usedWords.push(insult);
                    if (usedWords.length > 10) usedWords.shift();
                }
            }

            // Обновляем ключ для следующей итерации
            const lastWords = result.slice(-this.order);
            currentKey = lastWords.join(' ');
        }

        return result.join(' ');
    }
}

// Шаг 5: История генераций
function loadHistory() {
    const history = JSON.parse(localStorage.getItem('history') || '[]');
    const historyDiv = document.getElementById('history');
    historyDiv.innerHTML = '';
    history.forEach(item => {
        const div = document.createElement('div');
        div.innerText = `${new Date(item.timestamp).toLocaleString()}: ${item.text.substring(0, 100)}...`;
        historyDiv.appendChild(div);
    });
}

function saveToHistory(text) {
    const history = JSON.parse(localStorage.getItem('history') || '[]');
    history.unshift({ text, timestamp: Date.now() });
    if (history.length > 10) history.pop();
    localStorage.setItem('history', JSON.stringify(history));
}

